import React from "react";
import { MapContainer, TileLayer, Marker, Popup } from "react-leaflet";
import "leaflet/dist/leaflet.css";

const UttarakhandTour = () => {
  return (
    <section className="my-6">
      <h2 className="text-2xl font-semibold text-center mb-4">
        Explore Uttarakhand
      </h2>
      <div className="w-full h-96">
        <MapContainer center={[30.3165, 78.0322]} zoom={8} className="h-full w-full">
          <TileLayer url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png" />
          <Marker position={[30.3165, 78.0322]}>
            <Popup>Dehradun - The Capital City</Popup>
          </Marker>
          <Marker position={[30.7363, 76.7884]}>
            <Popup>Mussoorie - The Queen of Hills</Popup>
          </Marker>
        </MapContainer>
      </div>
    </section>
  );
};

export default UttarakhandTour;
